  null,\n\t\"notes\": \"PlanWorks is a Web resource that supports collaborative decision
  making in transportation planning and project development. PlanWorks is built around
  key decision points in long-range planning, programming, corridor planning, and
  environmental review. PlanWorks suggests when and how to engage cross-disciplinary
  partners and stakeholder groups. PlanWorks has four major components:-A troubleshooting
  guide describing the common decision points and opportunities for cooperation in
  the transportation planning and environmental review process. For each of the key
  decision points, PlanWorks provides policy and stakeholder questions, data needs,
  case studies and examples, and links to tools that can help support the decision.-Interactive
  assessments that enable project stakeholders to identify opportunities to work together,
  improve interagency cooperation, and expedite project delivery.\",\n\t\"license_title\":
